import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about">
      <h2>About</h2>
      <p>Providing Professional Surfing Lessons Since 2010.</p>
      <p>At Surf School, we pride ourselves on delivering top-notch surfing lessons with unparalleled attention to detail. Our team of skilled professionals is dedicated to making your surfing experience enjoyable and memorable.</p>
    </div>
  );
};

export default About;
